No.

The query is asking for subjects (?s1) that are in the administrative unit (wdt:P131) of the Mount Everest (wd:Q513), but the question is asking in which country (Land) the Mount Everest lies. 

The query should be modified to: SELECT DISTINCT ?s1 WHERE { wd:Q513 wdt:P131 ?s1 . ?s1 wdt:P31 wd:Q6256 . }
